    [],nt"num_tags": 4,nt"name": "a-narrative-report-mingo-national-wildlife-refuge-january-december-1964",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Mingo
    National Wildlife Refuge outlines Refuge accomplishments during the 1964 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, vegetation
    control, and wildfires. Resource management is outlined; topics include grazing,
    fur harvesting, and timber removal. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, violations, and safety.
    Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
